var stickyMenu = (function() {

    var $window =  $(window);
    var $menu =  $('.nav-combined-container');
    var $topMenuHeight =  $('.nav-top > li').innerHeight();

    var stickyMenu = function (e) {

        var scrollHasPastTopNavi =  function () {
            return $window.scrollTop() >= $topMenuHeight;
        };

        var isStickyMenu = function () {
            return !$menu.hasClass('sticky') && $menu.hasClass('is-sticky');
        };

        var isDesktop = function () {
            return currentMediaQuery("md") || currentMediaQuery("lg");
        };

        var shouldStickMenu = function () {
            return scrollHasPastTopNavi() && isStickyMenu() && isDesktop();
        };

        if ( shouldStickMenu() ) {
            $menu.addClass('sticky');
            $menu.css({marginTop: -$topMenuHeight});
            $menu.after( "<div class='sticky-filler' style='height:"  + $menu.innerHeight() + "px;'></div>" );
        } else if ( $window.scrollTop() <= $topMenuHeight) {
            $menu.removeClass('sticky');
            $menu.css({marginTop: 0});
            $('.sticky-filler').remove();
        } else {
        }
    };

    $window.on("scroll",stickyMenu);

})();

/* fix iOS mobile keyboard
 * ====================== */
(function(){
    var targetElem = $('.is-sticky'),
        $doc       = $(document);

    if( !targetElem.length || !navigator.userAgent.match(/iPhone|iPad|iPod/i) )
        return;

    $doc.on('focus.iOSKeyboardFix', 'input, textarea, [contenteditable]', bind);

    function bind(){
        $(window).on('scroll.iOSKeyboardFix', react);
        react();
    }

    function react(){
        var offsetY = targetElem.offset().top,
            scrollY = $(window).scrollTop(),
            changeY = offsetY - scrollY;

        targetElem.css({'top':'-'+changeY+'px'});

        $doc.on('blur.iOSKeyboardFix', 'input, textarea, [contenteditable]', unbind);
        $doc.on('touchend.iOSKeyboardFix', unbind);
    }

    function unbind(){
        targetElem.css({'top':0});
        document.activeElement.blur();

        $(window).off('scroll.iOSKeyboardFix');
        $doc.off('touchend.iOSKeyboardFix blur.iOSKeyboardFix');
    }
})();


function currentMediaQuery(size) {
    var selectedSize = ".mq-detector.visible-" + size;
    return $(selectedSize).css("display") == "block";
};

var consistentAlign = (function ($) {

    function align () {
        if (!currentMediaQuery("xs")) {
            var $rows = $(".row");
            $rows.each(function(index, row) {
                var $alignableElements = $(row).find(".consistent-align");
                if ($alignableElements.length) {
                    var heights = $alignableElements.map(function (index, div) {
                        return $(div).innerHeight();
                    });
                    var biggestHeight = _(heights).max();
                    $alignableElements.css("min-height", biggestHeight);
                }
            });
        }
    }

    function ie8or9 () {
        return $("html").hasClass("ie8") || $("html").hasClass("ie9");
    }

    $(window).resize(_.debounce(function () {
        if (!ie8or9()) align();
    }, 100));

    $(window).load(function () {
        align();
    });


})(jQuery);

var consistentWidth = (function ($) {

    function equalize () {
        var $rows = $(".row");
        $rows.each(function(index, row) {
            var $alignableElements = $(row).find(".consistent-width");
            if ($alignableElements.length) {
                var widths = $alignableElements.map(function (index, div) {
                    return $(div).innerWidth();
                });

                var biggestWidth = _(widths).max();
                $alignableElements.css("min-width", biggestWidth);
            }
        });
    }

    $(window).load(function () {
        equalize();
    });

})(jQuery);

